import { Component, OnInit } from '@angular/core';
import { jsPDF } from 'jspdf';
import autoTable from 'jspdf-autotable';
import { Share } from '@capacitor/share';
import { Filesystem, Directory } from '@capacitor/filesystem';
import { IonHeader, IonLabel, IonToolbar, IonButton, IonInput, IonItem, IonListHeader, IonContent, IonIcon, IonButtons, IonTitle, IonModal, IonList, IonCheckbox } from "@ionic/angular/standalone";
import { FormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common';
import { NavController } from '@ionic/angular';
import { addIcons } from 'ionicons';
import { arrowBackOutline, logoWhatsapp, trashOutline, settingsOutline } from 'ionicons/icons';
import { Router } from '@angular/router';
import { Leads } from '../../services/leads';

@Component({
  selector: 'app-quotation',
  templateUrl: './quotation.page.html',
  styleUrls: ['./quotation.page.scss'],
  standalone: true,
  imports: [IonTitle, FormsModule, CommonModule, IonButtons, IonIcon, IonContent, IonListHeader, IonItem, IonLabel, IonInput, IonToolbar, IonButton, IonHeader, IonModal, IonList, IonCheckbox],
})
export class QuotationPage implements OnInit {
  // Configurable rates
  gstPercentage: number = 18;
  discountPercentage: number = 10;
  showSettings: boolean = false;
  isItemModalOpen: boolean = false;

  // Form Fields
  customerName: string = '';
  siteAddress: string = '';
  contact: string = '';

  // Items
  availableItems: any[] = [];
  selectedItems: any[] = [];

  constructor(private navCtrl: NavController, private router: Router, private leads: Leads) {
    addIcons({ arrowBackOutline, logoWhatsapp, trashOutline, settingsOutline });
    const navigation = this.router.getCurrentNavigation();
    if (navigation?.extras.state) {
      this.customerName = navigation.extras.state['customerName'];
      this.contact = navigation.extras.state['contact'];
      this.siteAddress = navigation.extras.state['city'];
    }
  }

  ngOnInit(): void {
    this.loadItems();
  }

  loadItems() {
    this.leads.getItems().subscribe((res: any) => {
      this.availableItems = res.map((item: any) => ({ ...item, selected: false, quantity: 1 }));
    });
  }

  openItemSelectionModal() {
    this.isItemModalOpen = true;
  }

  addSelectedItems() {
    const newItems = this.availableItems.filter(item => item.selected).map(item => ({ ...item }));
    this.selectedItems.push(...newItems);
    this.availableItems.forEach(item => item.selected = false);
    this.isItemModalOpen = false;
  }

  removeItem(index: number) {
    this.selectedItems.splice(index, 1);
  }

  get subTotal() { return this.selectedItems.reduce((acc, item) => acc + (item.price * (item.quantity || 0)), 0); }
  get discountAmount() { return this.subTotal * (this.discountPercentage / 100); }
  get gstAmount() {
    return this.selectedItems.reduce((acc, item) => {
      const gst = item.gst !== undefined ? item.gst : this.gstPercentage;
      const amount = item.price * (item.quantity || 0);
      const discountedAmount = amount * (1 - this.discountPercentage / 100);
      return acc + (discountedAmount * gst / 100);
    }, 0);
  }
  get grandTotal() {
    return (this.subTotal - this.discountAmount) + this.gstAmount;
  }

  async generatePDF() {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const pageHeight = doc.internal.pageSize.getHeight();
    const margin = 14;
    const rightEdge = pageWidth - margin;

    const now = new Date();
const month = now.toLocaleString('en-IN', { month: 'short' }).toUpperCase();
const date = now.getDate().toString().padStart(2, '0');
const year = now.getFullYear();
const unixSuffix = Date.now().toString().slice(-4);

const quoteId = `Q${month}${date}${year}${unixSuffix}`;

    // BRAND COLORS
    const brandNavy: [number, number, number] = [20, 33, 61];
    const brandGold: [number, number, number] = [184, 146, 74];
    const brandSand: [number, number, number] = [250, 248, 242];
    const textMain: [number, number, number] = [30, 30, 30];
    const textMuted: [number, number, number] = [100, 100, 100];

    // 1. LOGO & HEADER
    const logoBase64 = 'data:image/png;base64,'; // Ensure this is your full logo string
    try { if (logoBase64) doc.addImage(logoBase64, 'PNG', margin, 12, 35, 35); } catch (e) { }

    doc.setFont('helvetica', 'bold');
    doc.setFontSize(18);
    doc.setTextColor(brandNavy[0], brandNavy[1], brandNavy[2]);
    doc.text('BRAHMADEV CONSTRUCTIONS', rightEdge, 22, { align: 'right' });

    doc.setFont('helvetica', 'normal');
    doc.setFontSize(9);
    doc.setTextColor(textMuted[0], textMuted[1], textMuted[2]);
    doc.text([
      'Opp. Durgalakshmi Multiplex, Miraj Road,',
      'Athani, Karnataka - 591304',
      'Ph: +91 88849 50068',
      'Email: brahmadevaconstructions@gmail.com',
      'GSTIN: 29FHSPB9789R1ZO, PAN Number: FHSPB9789R'
    ], rightEdge, 28, { align: 'right' });

    doc.setDrawColor(brandGold[0], brandGold[1], brandGold[2]);
    doc.setLineWidth(0.8);
    doc.line(margin, 52, rightEdge, 52);

    // 2. CLIENT INFO BOX
    doc.setFillColor(brandSand[0], brandSand[1], brandSand[2]);
    doc.roundedRect(margin, 58, pageWidth - (margin * 2), 35, 3, 3, 'F');

    doc.setFontSize(9);
    doc.setFont('helvetica', 'bold');
    doc.setTextColor(brandGold[0], brandGold[1], brandGold[2]);
    doc.text('QUOTATION FOR:', 20, 66);
    doc.text('QUOTE DETAILS:', rightEdge - 6, 66, { align: 'right' });

    doc.setFontSize(11);
    doc.setTextColor(brandNavy[0], brandNavy[1], brandNavy[2]);
    doc.text(this.customerName.toUpperCase() || 'VALUED CUSTOMER', 20, 72);
    doc.text(`DATE: ${new Date().toLocaleDateString('en-IN')}`, rightEdge - 6, 72, { align: 'right' });

    doc.setFont('helvetica', 'normal');
    doc.setFontSize(9);
    doc.setTextColor(textMain[0], textMain[1], textMain[2]);
    doc.text(`Site: ${this.siteAddress || '-'}`, 20, 78);
    doc.text(`Contact: ${this.contact || '-'}`, 20, 84);
    doc.text(`Quote ID: ${quoteId}`, rightEdge - 6, 78, { align: 'right' });

    // Calculate GST Breakdown
    const gstBreakdown: { [key: number]: number } = {};
    this.selectedItems.forEach(item => {
      const gst = item.gst !== undefined ? item.gst : this.gstPercentage;
      const amount = Number(item.price) * Number(item.quantity);
      const discountedAmount = amount * (1 - this.discountPercentage / 100);
      const tax = discountedAmount * gst / 100;
      gstBreakdown[gst] = (gstBreakdown[gst] || 0) + tax;
    });

    const breakdownText = Object.keys(gstBreakdown).map(rateStr => {
      const rate = parseFloat(rateStr);
      const tax = gstBreakdown[rate];
      const halfRate = rate / 2;
      const halfTax = tax / 2;
      return `CGST (${halfRate}%): Rs. ${halfTax.toLocaleString()}  SGST (${halfRate}%): Rs. ${halfTax.toLocaleString()}`;
    }).join('\n');

    const breakdownRows = breakdownText ? [[{ content: breakdownText, colSpan: 5, styles: { halign: 'right', textColor: textMuted, fontSize: 8 } as any }]] : [];

    // 3. ITEMS TABLE
    autoTable(doc, {
      startY: 100,
      margin: { bottom: 30 }, // Ensure table doesn't hit the footer
      head: [['Work Description', 'Qty', 'Rate', 'GST', 'Total']],
      body: [
        ...this.selectedItems.map(item => {
          const gst = item.gst !== undefined ? item.gst : this.gstPercentage;
          const amount = Number(item.price) * Number(item.quantity);
          const discountedAmount = amount * (1 - this.discountPercentage / 100);
          const discountedPrice = Number(item.price) * (1 - this.discountPercentage / 100);
          const gstValue = discountedAmount * gst / 100;
          return [
            { content: item.description, styles: { fontStyle: 'bold' } as any },
            `${item.quantity} ${item.unit}`,
            `Rs. ${discountedPrice.toLocaleString()}`,
            `Rs. ${gstValue.toLocaleString()} (${gst}%)`,
            `Rs. ${discountedAmount.toLocaleString()}`
          ];
        }),
        [{ content: `Total GST`, colSpan: 4, styles: { halign: 'right', textColor: textMuted } as any }, { content: `Rs. ${this.gstAmount.toLocaleString()}`, styles: { fontStyle: 'bold' } as any }],
        ...breakdownRows,
        [{ content: 'Grand Total', colSpan: 4, styles: { halign: 'right', fontStyle: 'bold' } as any }, { content: `Rs. ${this.grandTotal.toLocaleString()}`, styles: { fontStyle: 'bold', fillColor: [240, 240, 240] } as any }]
      ] as any[][],
      theme: 'striped',
      headStyles: { fillColor: brandNavy, textColor: 255 },
      styles: { fontSize: 9, cellPadding: 4 },
      columnStyles: { 0: { cellWidth: 80 } }
    });

   // 4. PAYMENT & QR SECTION (Balanced 3-Column Layout)
    let finalY = (doc as any).lastAutoTable.finalY + 10;
    const boxHeight = 35;
    
    // Check if we need a new page for payment section and signature
    if (finalY + boxHeight + 50 > pageHeight - 15) {
      doc.addPage();
      finalY = 20;
    }
    
    // Background Box
    doc.setFillColor(brandSand[0], brandSand[1], brandSand[2]);
    doc.roundedRect(margin, finalY, pageWidth - (margin * 2), boxHeight, 2, 2, 'F');

    // --- COLUMN 1: BANK DETAILS (LEFT) ---
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(9);
    doc.setTextColor(brandGold[0], brandGold[1], brandGold[2]);
    doc.text('BANK DETAILS:', margin + 5, finalY + 8);

    doc.setFont('helvetica', 'normal');
    doc.setTextColor(textMain[0], textMain[1], textMain[2]);
    doc.text([
      'Bank: FEDERAL BANK',
      'A/c Name: BRAHMADEV CONSTRUCTIONS',
      'A/c No: 15070200006571',
      'IFSC: FDRL0001507'
    ], margin + 5, finalY + 15);

    // --- COLUMN 2: TERMS (CENTER) ---
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(9);
    doc.setTextColor(brandGold[0], brandGold[1], brandGold[2]);
    doc.text('QUOTATION TERMS:', pageWidth / 2, finalY + 8, { align: 'center' });

    doc.setFont('helvetica', 'normal');
    doc.setFontSize(8);
    doc.setTextColor(textMain[0], textMain[1], textMain[2]);
    doc.text([
      '1. Valid for 15 days from date.',
      '2. 50% Advance with order.',
      '3. Tax as per Govt. norms.',
      '4. Site water/power by client.'
    ], pageWidth / 2, finalY + 15, { align: 'center' });

    // --- COLUMN 3: QR CODE (RIGHT) ---
    const upiId = 'brahmadev6571@fbl';
    const payeeName = 'Brahmadev Constructions';
    const amount = this.grandTotal.toFixed(2); // UPI requires 2 decimal places
    const note = quoteId; // e.g., QFEB2620261234

    // 2. Construct the UPI URL
    // We encode Name and Note to handle spaces or special characters
    const upiUrl = `upi://pay?pa=${upiId}&pn=${encodeURIComponent(payeeName)}&tn=${encodeURIComponent(note)}&cu=INR`;

    // 3. Generate the QR URL
    // Increased size to 200x200 for better scan reliability with long URLs
    const qrUrl = `https://api.qrserver.com/v1/create-qr-code/?size=100x100&data=${encodeURIComponent(upiUrl)}`;    
    const qrSize = 18; // Slightly smaller to create more white space
    const qrX = rightEdge - qrSize - 5;
    
    try { 
      doc.addImage(qrUrl, 'PNG', qrX, finalY + 5, qrSize, qrSize); 
      doc.link(qrX, finalY + 5, qrSize, qrSize, { url: upiUrl });
      
      doc.setFontSize(7);
      doc.setTextColor(textMuted[0], textMuted[1], textMuted[2]);
      const qrCenterX = qrX + (qrSize / 2);
      doc.text('Scan to Pay', qrCenterX, finalY + 26, { align: 'center' });
      doc.setFontSize(6);
      doc.text(upiId, qrCenterX, finalY + 29, { align: 'center' });
    } catch (e) { console.error("QR Error", e); }

    // 5. SIGNATURE SECTION (Adjusted spacing)
    const sigY = finalY + boxHeight + 20;
    // doc.setFontSize(9);
    // doc.setFont('helvetica', 'bold');
    // doc.setTextColor(brandNavy[0], brandNavy[1], brandNavy[2]);
    // doc.text('FOR BRAHMADEV CONSTRUCTIONS', rightEdge, sigY + 10, { align: 'right' });
    
    doc.setDrawColor(brandGold[0], brandGold[1], brandGold[2]);
    doc.setLineWidth(0.5);
    doc.line(rightEdge - 45, sigY + 10, rightEdge, sigY + 10);
    
    doc.setFont('helvetica', 'normal');
    doc.text('Authorized Signatory', rightEdge, sigY + 15, { align: 'right' });

    // 6. GLOBAL FOOTER RULE (On every page)
    const totalPages = (doc as any).internal.getNumberOfPages();
    for (let i = 1; i <= totalPages; i++) {
      doc.setPage(i);
      doc.setDrawColor(brandNavy[0], brandNavy[1], brandNavy[2]);
      doc.line(margin, 285, rightEdge, 285);
      doc.setFontSize(7);
      doc.setTextColor(100);
        doc.text('Notice: Payments are only valid via the bank/UPI details listed on this quote. Other payment methods are not authorized or recognized.', pageWidth / 2, 290, { align: 'center' });
    }

    // SHARE
    const pdfBase64 = doc.output('datauristring').split(',')[1];
    const fileName = `Quote_${this.customerName || 'Client'}.pdf`;
    const savedFile = await Filesystem.writeFile({ path: fileName, data: pdfBase64, directory: Directory.Cache });
    await Share.share({ url: savedFile.uri });
  }

  back() { this.navCtrl.back(); }
  addLead() { this.navCtrl.navigateForward('/layout/items'); }
}